import {
  IonButton,
  IonButtons,
  IonContent,
  IonPage,
  IonToolbar,
} from "@ionic/react";
import React from "react";

const SignIn: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <IonToolbar>
          <IonButtons>
            <IonButton href="/signUp"> To Sign Up</IonButton>
            <IonButton href="/dashboard"> To Dashboard</IonButton>
          </IonButtons>
        </IonToolbar>
      </IonContent>
    </IonPage>
  );
};

export default SignIn;
